script: |
  super -f text -I q5323.spq | sort > q5323.out

inputs:
  - name: q5323.spq
    data: |
      SELECT DISTINCT - COUNT ( * ) AS col2, COUNT ( * ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5323.out
    data: |
      -9	9
